from langchain.prompts import ChatPromptTemplate, HumanMessagePromptTemplate
from langchain_google_genai import ChatGoogleGenerativeAI
from dotenv import load_dotenv

load_dotenv()
encoded_img = "data:image/jpeg;base64,"
encoded_img2 = "data:image/png;base64,"

llm = ChatGoogleGenerativeAI(
    model="gemini-1.5-flash",
    temperature=0,
)

prompt_template =  HumanMessagePromptTemplate.from_template(
            template=[
                {"type": "text", "text": "Summarize this two image"},
                {
                    "type": "image_url",
                    "image_url": "{encoded_image_url2}",
                },
                {
                    "type": "image_url",
                    "image_url": "{encoded_image_url}",
                },
            ]
        )

summarize_image_prompt = ChatPromptTemplate.from_messages([prompt_template])

# Pydantic schema
print(summarize_image_prompt.get_input_schema().schema_json())

chain = summarize_image_prompt | llm
# Invoke the chain
response = chain.invoke(input={"encoded_image_url":encoded_img,"encoded_image_url2":encoded_img2})

print(response)
